class Comments extends React.Component {


	render(){ 

		return(
			<div className="ui segment" style={{width: "70%"}}>
				<div className="ui relaxed divided list">
					<div class="item">
	      				<div class="content">
	        				<div class="header">Andre</div>
	        				An excellent person
	      				</div>
	    			</div>
	    			<div class="item">
	      				<div class="content">
	        				<div class="header">Dre</div>
	        				A better person
	      				</div>
	    			</div>
				</div>
			</div>
		);

	}


}

export default Comments;
